import counterReducer from "./counter";
import actionTypes from "../actions/actionTypes";
import { combineReducers } from "redux";

const rootReducer = combineReducers({
  ctr: counterReducer,
});

export interface IRootReducer {
  ctr: counterReducer;
}

export default rootReducer;
